import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const filter = {}

const params = Object.entries(filter)
  .map((arr) => `${arr[0]}=${arr[1]}`)
  .toString()
  .replaceAll(',', '&')

const URL = `${baseURL}/${'route'}${Object.keys(params).length > 0 ? '?' : ''}${params}`

const buuks = (route: string, filter?: Record<string, string>) => {
  const params = Object.entries(filter as Object)
    .map((arr) => `${arr[0]}=${arr[1]}`)
    .toString()
    .replaceAll(',', '&')
  return fetch(`${baseURL}/${route}${Object.keys(params || {}).length > 0 ? '?' : ''}${params}`)
}

console.log('buukss', URL)

export default buuks
